import React from "react";
import PropTypes from "prop-types"

// component with props
function Food({name, picture, rating}){
    return (
        <div>
            <h2>I like {name}</h2>
            <h4>{rating}/5.0</h4>
            <img src={picture} alt={name}/>
        </div>
    )
}

Food.propTypes = {
    name: PropTypes.string.isRequired,
    picture: PropTypes.string.isRequired,
    rating: PropTypes.number
}

const foodILike = [
    {
        id: 1,
        name: "Kimchi",
        image: "data:image/jpeg;base64,",
        rating: 5
    },
    {
        id: 2,
        name: "samgyeopsal",
        image: "data:image/jpeg;base64,",
        rating: 4.9
    },
    {
        id: 3,
        name: "lamen",
        image: "data:image/jpeg;base64,",
        rating: 4
    }
];

function App() {
  return (
      <div>
        <h1>Hello</h1>
          {foodILike.map(dish => (
              <Food key={dish.id}
                    name={dish.name}
                    picture={dish.image}
                    rating={dish.rating} />
          ))};
      </div>
  );
}

export default App;
